//import liraries
import React, { Component } from 'react';
import { View, Text, StyleSheet } from 'react-native';
import First from './Screens/First';
import Second from './Screens/Second';
import Third from './Screens/Third';
import Fourth from './Screens/Fourth';

import { createDrawerNavigator } from '@react-navigation/drawer';
import { NavigationContainer } from '@react-navigation/native';
const Drawer=createDrawerNavigator();
// create a component
const App = () => {
  return (
    <NavigationContainer>
      <Drawer.Navigator initialRouteName="First">
        <Drawer.Screen  name="First" component={First}/>
        <Drawer.Screen  name="Second" component={Second} />
        <Drawer.Screen  name="Third" component={Third} />
        <Drawer.Screen  name="Fourth" component={Fourth} />
      </Drawer.Navigator>
    </NavigationContainer>
  );
};


export default App;
